import { React, useState } from "react";
import "./Registracija.css";

const Registracija = () => {
  const [kime, setKime] = useState();
  const handleIme = (event) => {
    setKime(event.target.value);
  };

  const [ime, setIme] = useState();
  const [prezime, setPrezime] = useState();
  const [lozinka, setLozinka] = useState();

  return (
    <form>
      <label>
        <p>Korisničko ime:</p>
        <input
          type="text"
          name="kime"
          placeholder="Korisničko ime"
          id="kime"
          value={kime}
          onChange={handleIme}
        />
      </label>
      <label>
        <p>Ime:</p>
        <input
          type="text"
          name="ime"
          placeholder="ime"
          id="ime"
          value={ime}
          onChange={setIme}
        />
      </label>
      <label>
        <p>Prezime:</p>
        <input
          type="text"
          name="prezime"
          placeholder="Prezime"
          id="prezime"
          value={prezime}
          onChange={setPrezime}
        />
      </label>
      <label>
        <p>Lozinka:</p>
        <input
          type="text"
          name="lozinka"
          placeholder="Lozinka"
          id="lozinka"
          value={lozinka}
          onChange={setLozinka}
        />
      </label>
      <input type="submit" value="Submit" />
    </form>
  );
};

export default Registracija;
